import './hero.styles.scss';
import Buton from "../button/button";

const Hero = () => {
    return (
        <section className='hero is-info is-large'>
  <div className='hero-body'>
    <div className='container'>
      <h1 className='title'>
        Bags reimagined for modern life.
      </h1>
      <div className='shop-now-btn'>
        <Buton />
      </div>
    </div>
  </div>
</section>
    );
}

export default Hero;
